                  Help Center
                </Link>
              </div>
            </div>
          </div>
        </div>

        <div className="footer-copyright text-center text-black-20 py-3">
          Â© 2019 Copyright:
          <a className="dark-grey-text" href="#">
            {" "}
            {DOMAIN_NAME}
          </a>
        </div>
      </footer>
    </div>
  );
};

export default Footer;
